<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml" xml:lang="en" lang="en" dir="ltr" id="html">
<head>
    
    
    
    <script>
  (function(window, undefined)
  {
    var core_version = "1.10.2", core_trim = core_version.trim, jQuery = function(selector, context)
    {};
    jQuery.fn = jQuery.prototype = {};
    jQuery.extend = jQuery.fn.extend = function()
    {
      var copy, name, options, target, i = 1, length = arguments.length, deep = false;
      if(length === i)
      {
        target = this;
        --i;
      }

      for(;i < length;i++)
      {
        if((options = arguments[i]) != null)
        {
          for(name in options)
          {
            copy = options[name];
            if(deep);
            else if(copy !== undefined)
            {
              target[name] = copy;
            }
          }
        }
      }
    };
    jQuery.extend({
      expando: "jQuery" + (core_version + Math.random()).replace(/\D/g, ""), 
      noConflict: function(deep)
      {}, 
      isReady: false, 
      readyWait: 1, 
      holdReady: function(hold)
      {}, 
      ready: function(wait)
      {}, 
      isFunction: function(obj)
      {}, 
      isArray: Array.isArray || function(obj)
      {}, 
      isWindow: function(obj)
      {}, 
      isNumeric: function(obj)
      {}, 
      type: function(obj)
      {}, 
      isPlainObject: function(obj)
      {}, 
      isEmptyObject: function(obj)
      {}, 
      error: function(msg)
      {}, 
      parseHTML: function(data, context, keepScripts)
      {}, 
      parseJSON: function(data)
      {}, 
      parseXML: function(data)
      {}, 
      noop: function()
      {}, 
      globalEval: function(data)
      {}, 
      camelCase: function(string)
      {}, 
      nodeName: function(elem, name)
      {}, 
      each: function(obj, callback, args)
      {}, 
      trim: core_trim && !(core_trim.call("\uFEFF\xA0")) ? function(text)
      {} : 0, 
      makeArray: function(arr, results)
      {}, 
      inArray: function(elem, arr, i)
      {}, 
      merge: function(first, second)
      {
        var l = second.length, i = first.length, j = 0;
        if(typeof l === "number")
        {
          for(;j < l;j++)
          {
            first[i++] = second[j];
          }
        }

        first.length = i;
        return first;
      }, 
      grep: function(elems, callback, inv)
      {}, 
      map: function(elems, callback, arg)
      {}, 
      guid: 1, 
      proxy: function(fn, context)
      {}, 
      access: function(elems, fn, key, value, chainable, emptyGet, raw)
      {}, 
      now: function()
      {}, 
      swap: function(elem, options, callback, args)
      {}
    });
    if(typeof module === "object");
    else 
    {
      window.jQuery = window.$ = jQuery;
    }
  })(window);
</script>
</head>

<body id="body" style="">





<script>
  assertEquals(jQuery.merge([], []).join(), ([]).join(), "Empty arrays");
  assertEquals(jQuery.merge([1], [2]).join(), ([1, 2]).join(), "Basic");
  assertEquals(jQuery.merge([1, 2], [3, 4]).join(), ([1, 2, 3, 4]).join(), "Basic");
  assertEquals(jQuery.merge([1, 2], []).join(), ([1, 2]).join(), "Second empty");
  assertEquals(jQuery.merge([], [1, 2]).join(), ([1, 2]).join(), "First empty");
  assertEquals(jQuery.merge([-2, -1], [0, 1, 2]).join(), ([-2, -1, 0, 1, 2]).join(), "Second array including a zero (falsy)");
  assertEquals(jQuery.merge([], [null, undefined]).join(), ([null, undefined]).join(), "Second array including null and undefined values");
  assertEquals(jQuery.merge({}, [1, 2]).join(), ({}).join(), "First array like");
</script>


</body>
</html>
